import React from 'react';
import { makeStyles } from '@mui/material/styles';
import Container from '@mui/material/Container';
import Button from '@mui/materialButton';
import FacebookIcon from '@mui/material/icons/Facebook';
import LinkedInIcon from '@mui/material/icons/LinkedIn';
import { IconButton } from '@mui/material/core';
import TextBox from '../components/small-components/TextBox';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: theme.spacing(10),
    paddingBottom: theme.spacing(10),
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    width: '100%',
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
  },
  button: {
    margin: theme.spacing(2),
  },
  socialButtons: {
    display: 'flex',
    justifyContent: 'center',
    marginTop: theme.spacing(2),
  },
  socialButton: {
    margin: theme.spacing(1),
  },
  signUpLink: {
    marginTop: theme.spacing(2),
  },
}));

const SignUpPage = () => {
  const classes = useStyles();

  return (
    <Container maxWidth="sm" className={classes.root}>
      <form className={classes.form}>
        <TextBox title="Username" placeholder="Enter your username" />
        <TextBox title="Password" placeholder="Enter your password" />
        <Button variant="contained" color="primary" className={classes.button}>
          Sign in with Google
        </Button>
        <div className={classes.socialButtons}>
          <IconButton color="primary" className={classes.socialButton}>
            <FacebookIcon />
          </IconButton>
          <IconButton color="primary" className={classes.socialButton}>
            <LinkedInIcon />
          </IconButton>
        </div>
        <a href="#" className={classes.signUpLink}>
          SignUp!
        </a>
      </form>
    </Container>
  );
};

export default SignUpPage;
